  return (
    <div>
      <Header /> {/* Include Header at the top */}
      <main>
        <h1>Welcome to Our Flight Reservation Service</h1>
        <p>Find and book flights with ease.</p>

        {/* You can add more components like a QuickSearch here */}
      </main>
      <Footer /> {/* Include Footer at the bottom */}
    </div>
  );
};

export default HomePage;
